import React from 'react';
import './Home.css';

function Home(){
    return( 
    <div className='home-container'>
        <h2 className='home-overview'>Overview</h2>
        <p className='overview-description'>Join us this festive season in paying back to the food delivery drivers! Pay a meal forward and dine in with them.
            Happy Holidays!
        </p>
        <div className='driver-contianer'>
            <h2 className='driver-header'>Here as a delivery driver?</h2>
            <p>Log in or sign up now!</p>
            <button className='login-button'>Login</button>
            <button className='signup-button'>Sign Up</button>
        </div>
        <div className='business-container'>
            <h2 className='business-header'>Here as an owner of an eatery?</h2>
        </div>
    </div>

);
}

export default Home;
